// c:/Users/didxo/OneDrive/Desktop/3rd project code(flask)/my-react-app/src/app/analysis.jsx
import React from "react";
// Ensure this path is correct for your project structure
import "./styles/analysis.css";
import logoImage from "../../assets/logo.svg"; // Example if logo is imported
import copyIconPath from "../assets/icons/copy.svg"; // Example path
import evaluationIconPath from "../assets/icons/evaluation.svg"; // Example path
// import videoThumbnailPath from '../assets/images/video_thumbnail.jpg'; // Example path

// Default placeholder data if props are not provided
const defaultAnalysisResult = {
	videoThumbnail:
		"https://via.placeholder.com/361x232.png?text=Video+Thumbnail",
	score: 0,
	exerciseCount: 0,
	feedbackQuote: "운동 분석 결과를 기다리고 있습니다...",
	detailedFeedback: "운동 영상이 분석되면 여기에 AI 피드백이 표시됩니다.",
	// For icons, it's better to import them or use public paths like /assets/icons/copy.svg
	// Ensure these files exist in your public/assets/icons/ directory or adjust paths
	copyIcon: "/assets/icons/copy.svg", // 실제 public 폴더 내 경로로 수정 필요
	evaluationIcon: "/assets/icons/evaluation.svg", // 실제 public 폴더 내 경로로 수정 필요
};

const AnalysisPage = ({ analysisData }) => {
	// Use passed analysisData or fallback to defaultAnalysisResult
	// This allows data to be fetched from elsewhere and passed as a prop
	const currentAnalysis = analysisData || defaultAnalysisResult;

	// const [isModalOpen, setIsModalOpen] = React.useState(false);
	// const openModal = () => setIsModalOpen(true);
	// const closeModal = () => setIsModalOpen(false);

	// Dummy function for copy to clipboard
	const handleCopyFeedback = () => {
		navigator.clipboard
			.writeText(currentAnalysis.detailedFeedback)
			.then(() => alert("피드백이 복사되었습니다!"))
			.catch((err) => console.error("피드백 복사 실패:", err));
	};

	const handleEvaluationClick = () => {
		alert("평가 기준 모달 열기 기능 구현 예정");
		// openModal();
	};

	return (
		<div className="analysis">
			<div className="overlap-wrapper">
				<header className="analysis-page-header">
					<div className="logo"></div>{" "}
					{/* This div will be styled with the background logo image */}
					<h1 className="header-title"></h1>
				</header>

				{/* 메인 콘텐츠 스크롤 영역 */}
				<main className="analysis-content-area">
					<div className="analysis-video-container">
						<img
							className="analysis-video"
							alt="분석된 운동 영상"
							src={currentAnalysis.videoThumbnail}
						/>
					</div>

					{/* === NEW EXERCISE SUMMARY CARD === */}
					<div className="exercise-summary-card">
						<div className="summary-top-row">
							<div className="summary-score-box">
								<span className="score-value">{currentAnalysis.score}</span>
								<span className="score-unit">점</span>
							</div>
							<div className="summary-count-box">
								<span className="count-box-label">운동 결과</span>
								<p className="count-box-text">
									이번 운동으로 <span>{currentAnalysis.exerciseCount}</span>회
									했어요!
								</p>
							</div>
						</div>
						<div className="summary-feedback-quote">
							<p>"{currentAnalysis.feedbackQuote}"</p>
						</div>
					</div>
					{/* === END OF NEW EXERCISE SUMMARY CARD === */}

					{/* 피드백 섹션 */}
					<div className="feedback-container">
						<p className="feedback-text">{currentAnalysis.detailedFeedback}</p>
						<img
							className="copy-icon"
							alt="피드백 복사"
							src={currentAnalysis.copyIcon}
							onClick={handleCopyFeedback}
						/>
						{/* 평가 기준 버튼 영역 - 피드백 컨테이너 안으로 이동 */}
						{/* CSS에서 absolute positioning으로 우측 상단에 배치 */}
						<div
							className="evaluation-button-area"
							onClick={handleEvaluationClick}
						>
							<img
								className="evaluation-icon"
								alt="평가 기준"
								src={currentAnalysis.evaluationIcon}
							/>
							<span className="text-wrapper-8">평가기준</span>
						</div>
					</div>
				</main>

				{/* 평가 기준 모달 (isModalOpen 상태에 따라 표시) */}
				{/* {isModalOpen && (
          <div className="evaluation-modal-overlay" onClick={closeModal}>
            <div className="evaluation-modal-content" onClick={(e) => e.stopPropagation()}>
              <button className="close-modal-button" onClick={closeModal}>&times;</button>
              <h2>운동 자세 평가 기준</h2>
              <img className="evaluation-modal-image" src="https://via.placeholder.com/300x200.png?text=Evaluation+Criteria+Image" alt="평가 기준 이미지" />
              <p>스쿼트: 무릎이 발끝을 과도하게 넘지 않도록 주의합니다. 허리는 곧게 펴고, 엉덩이는 충분히 내려가야 합니다.</p>
              <p>플랭크: 몸이 머리부터 발끝까지 일직선을 유지해야 합니다. 복근에 힘을 주고 엉덩이가 처지거나 너무 올라가지 않도록 합니다.</p>
            </div>
          </div>
        )} */}
			</div>
		</div>
	);
};

export default AnalysisPage;
